pub fn interchangeable_rectangles(rectangles: Vec<Vec<i32>>) -> i64 {
    fn count_combinations(n: u64, r: u64) -> u64 {
        if r > n {
            0
        } else {
            (1..=r).fold(1, |acc, val| acc * (n - val + 1) / val)
        }
    }

    let mut map = std::collections::HashMap::new();
    for rec in rectangles {
        let ver: (u64, u64) = if rec[1] % rec[0] == 0 { (rec[1] as u64 / rec[0] as u64, 0)} else {
            let f = rec[1] as f64/rec[0] as f64;
            let i = f.floor();
            (i as u64, ((f - i) * 10000000000000000000f64).trunc() as u64)
        };
        let entry = map.entry(ver).or_insert(0i64);
        *entry += 1;
    }
    map.values().filter(|v|*v>&1).map(|v|count_combinations(*v as u64, 2) as i64).sum()
}